  // console.log(screen , "screen") 
  return (
    
    <div>
      <div>
        <header>
          <nav class="navbar">
            <img class="Logo" src={logo} alt=""></img>
            <div class="divlinks">
            <ul class="ullinks">
              <li class="Link1">
                <Link class="Links"  to="/">
                  Home
                </Link>
              </li>
              <li class="Link2">
                <Link class="Links" to="/aboutus">
                  About us
                </Link>
              </li>
              <li class="Link3">
                <Link class="Links"  to="/contactus">
                 Contact us</Link>
              </li>
            </ul>
            </div>
          </nav>  
          {/* <nav id="id1" class="hamnav"> 
      <div class="hamicon"> 
