                </Link>
              </li>
              <li >
                <Link   to="/contactus">
                 Contact us</Link>
              </li>
            </ul>
            
          
          
          </nav> */}
          {/* <img class="Logo" src={logo} alt=""></img> */}
         
          
       
        </header>
         <div class="imagecontainermobile">
        <img src={img} alt="Avatar" class="imagemobile" />
        <img src={img} alt="Avatar" class="imagemobile" />
        <img src={img} alt="Avatar" class="imagemobile" />
      </div> 
      <div class="boxes">
      <div class="box1">
        <img src={img2} alt="Avatar" class="imagelaptop1" />
        <div class="box1content1">
          <h1>are you student</h1>
        </div>
        </div>
      <div class="box2">
        <img src={img2} alt="Avatar" class="imagelaptop1" />
        <div class="box1content2">
          <h1>are you student</h1>
        </div>
        </div>
      <div class="box3">
        <img src={img2} alt="Avatar" class="imagelaptop1" />
        <div class="box1content">
          <h1>are you student</h1>
        </div>
        </div>
      </div>

      <div class="imagecontainerlaptop">
      
    
        
        <img src={img2} alt="Avatar" class="imagelaptop" />
        <img src={img2} alt="Avatar" class="imagelaptop" />
      </div>
      </div>
      {/* <div>
        <div class="container" id="container">
          <img src={img} alt="Avatar" class="image" id="image"/>
